Below is the graph of $y = a \sin (bx + c)$ for some positive constants $a,$ $b,$ and $c.$  Find the smallest possible value of $c.$

[asy]import TrigMacros;

size(300);

real f(real x)
{
	return 2*sin(4*x + pi/2);
}

draw(graph(f,-pi,pi,n=700,join=operator ..),red);
trig_axes(-pi,pi,-3,3,pi/2,1);
layer();
rm_trig_labels(-2,2, 2);

label("$1$", (0,1), E);
label("$2$", (0,2), E);
label("$-1$", (0,-1), E);
label("$-2$", (0,-2), E);
[/asy]

What is the matrix $\mathbf{M}$ that performs the transformation which sends square $ABCD$ to square $A'B'C'D'$?  (In particular, $A$ goes to $A',$ and so on.)

[asy]

size(200);
import graph;

pair Z=(0,0), A=(2,3), B=(-3,2), C=(-4,1), D=(-1,-4);

Label f; 
f.p=fontsize(6); 
xaxis(-1.5,1.5,Ticks(f, 1.0)); 
yaxis(-0.5,2.5,Ticks(f, 1.0));

draw((0,0)--(1,0)--(1,1)--(0,1)--(0,0),red);
dot((0,0)); label("$A=A'$", (0,0), SE);
dot((1,0)); label("$D$", (1,0), NE);
dot((1,1)); label("$C=D'$", (1,1), E);
dot((0,1)); label("$B$", (0,1), NE);

draw((0,0)--(1,1)--(0,2)--(-1,1)--(0,0), blue);
dot((0,2)); label("$C'$", (0,2), NE);
dot((-1,1)); label("$B'$", (-1,1), W);

[/asy]

A triangle has side lengths 7, 8, and 9.  There are exactly two lines that simultaneously bisect the perimeter and area of the triangle.  Let $\theta$ be the acute angle between these two lines.  Find $\tan \theta.$

[asy]
unitsize(0.5 cm);

pair A, B, C, P, Q, R, S, X;

B = (0,0);
C = (8,0);
A = intersectionpoint(arc(B,7,0,180),arc(C,9,0,180));
P = interp(A,B,(12 - 3*sqrt(2))/2/7);
Q = interp(A,C,(12 + 3*sqrt(2))/2/9);
R = interp(C,A,6/9);
S = interp(C,B,6/8);
X = extension(P,Q,R,S);

draw(A--B--C--cycle);
draw(interp(P,Q,-0.2)--interp(P,Q,1.2),red);
draw(interp(R,S,-0.2)--interp(R,S,1.2),blue);

label("$\theta$", X + (0.8,0.4));
[/asy]

